import React, { Component } from 'react';
import './about.css';

export class About extends Component {
    public render(): JSX.Element {
        return(
            <div className='about'>
                <h1>About</h1>
                <p>Project 3-Vacations</p>
                    <p>presented by Ofek Gabay </p>
                </div>
                
              )
        }
}
